CREATE TABLE `sim_operating_datas` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cd_machine_id` int(11) DEFAULT NULL COMMENT 'Referenz auf die Maschine',
  `group_id` int(11) DEFAULT NULL COMMENT 'Referenz auf die Gruppe',
  `period` int(11) DEFAULT NULL COMMENT 'Periode in der diese Daten angefallen sind',
  `simtime_start` int(11) DEFAULT NULL COMMENT 'Startzeit in Simulationszeit',
  `simtime_end` int(11) DEFAULT NULL COMMENT 'Endzeit in Simulationszeit',
  `day` int(11) DEFAULT NULL COMMENT 'Tag an dem dieser BDE Eintrag erstellt wurde',
  `day_start` int(11) DEFAULT NULL COMMENT 'Startzeitpunkt auf einen Tag formatiert',
  `day_end` int(11) DEFAULT NULL COMMENT 'Endzeitpunkt auf einen Tag formatiert',
  `shift` varchar(45) DEFAULT NULL COMMENT 'Schicht in der diese BDE Eintrag erstellt wurde',
  `production_order_id` int(11) DEFAULT NULL COMMENT 'Referenz auf die Produktionsbestellung',
  `sim_production_order_id` int(11) DEFAULT NULL COMMENT 'Refrenz auf den Produktionsauftrag',
  `shift_costs` double DEFAULT NULL COMMENT 'Lohnkosten fuer diesen BDE Auftrag',
  `machine_costs` double DEFAULT NULL COMMENT 'Maschinenkosten fuer diesen BDE Auftrag',
  `costs` double DEFAULT NULL COMMENT 'Gesamtkosten',
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Zeitstempel der Erstellung des Datensatzes',
  PRIMARY KEY (`id`),
  KEY `FK_GROUP_ID_GROUP_idx` (`group_id`),
  KEY `cd_machine_id` (`cd_machine_id`),
  KEY `sim_production_order_id` (`sim_production_order_id`),
  CONSTRAINT `FK_GROUP_ID_GROUP` FOREIGN KEY (`group_id`) REFERENCES `groups` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=7120 DEFAULT CHARSET=latin1 COMMENT='BDE Tabelle fuer die einzelnen Produktionsauftraege	';
