DROP TABLE IF EXISTS `sim_production_orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `sim_production_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `period` int(11) DEFAULT NULL COMMENT 'Periode',
  `cd_machine_id` int(11) DEFAULT NULL COMMENT 'Refrenz auf Maschine',
  `group_id` int(11) DEFAULT NULL COMMENT 'Refrenz auf Gruppe',
  `amount` int(11) DEFAULT NULL COMMENT 'Anzahl der Teile',
  `production_order_id` int(11) DEFAULT NULL COMMENT 'Referenz auf die Produktionsbestellung',
  `finished` tinyint(4) DEFAULT NULL COMMENT 'Fertiggestellt',
  `finish_period` double DEFAULT NULL COMMENT 'Fertiggestellt in Periode x',
  `cycle_time` int(11) DEFAULT NULL COMMENT 'Gesamte Durchlaufzeit die benoetigt wird',
  `elapsed_cycle_time` int(11) DEFAULT NULL COMMENT 'Bereits verstrichene Durchlaufzeit',
  `costs` double DEFAULT NULL COMMENT 'Angefallene Kosten',
  `set_up_time` double DEFAULT NULL COMMENT 'Ruestzeit',
  `clearing_time` double DEFAULT NULL COMMENT 'Abruestzeit',
  `cd_workflow_id` int(11) DEFAULT NULL COMMENT 'Refrenz auf Workflow',
  `cd_step_id` int(11) DEFAULT NULL COMMENT 'Refrenz auf Workflowschritt',
  `production_number` int(11) DEFAULT NULL COMMENT 'Eindeutige Nummer des Produktionsauftrages',
  `sequence` int(11) DEFAULT NULL COMMENT 'Reihenfolge des Auftrages',
  `color_gantt` varchar(45) DEFAULT NULL COMMENT 'Farbe innerhalb des GANTT Diagramms',
  `status` varchar(45) DEFAULT 'wait' COMMENT 'Status',
  `created` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT 'Zeitstempel der Erstellung des Datensatzes',
  PRIMARY KEY (`id`),
  KEY `FK_PRODORDERS_GROUP_idx` (`group_id`),
  KEY `FK_SIMPRODORDER_PRODORDER_idx` (`production_order_id`),
  KEY `cd_workflow_id` (`cd_workflow_id`),
  KEY `sequence` (`sequence`),
  KEY `cd_machine_id` (`cd_machine_id`),
  CONSTRAINT `FK_SIMPRODORDER_GROUP` FOREIGN KEY (`group_id`) REFERENCES `groups` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `FK_SIMPRODORDER_PRODORDER` FOREIGN KEY (`production_order_id`) REFERENCES `production_orders` (`id`) ON DELETE CASCADE ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=8735 DEFAULT CHARSET=latin1 COMMENT='Tabelle in der die Produktionsbestellungen in kleine Produktionsauftraege gesplittet vorliegen';
/*!40101 SET character_set_client = @saved_cs_client */;

